import child from '@/components/ProvideText/parent'
export default {
  name: 'ProvideGrandPa',
  components: { child },
  data: function() {
    return {
      nameObj: {
        name: '小布'
      },
      age: 12,
      city: '北京'
    }
  },
  provide() {
    return {
      nameObj: this.nameObj,
      cityFn: () => this.city,
      age: this.age

    }
  },
  methods: {
    changeName() {
      if (this.nameObj.name === '小布') {
        this.nameObj.name = '貂蝉'
        this.city = '香港'
        this.age = 24
      } else {
        this.nameObj.name = '小布'
        this.city = '北京'
        this.age = 12
      }
    }
  }
}
